import "../styles/main.css"
function Banner() {

    let history = useNavigate()

    const priceRedirect = () => {
        history.push("/price")
    }

    const placeHolder = () => {
        history.push("/placeholder")
    }

    return (
            <div className="position-absolute top-50 start-50 translate-middle text-bg-dark p-3"> 
